// HasTrustPortfolio applies the HasEdge predicate on the "trust_portfolio" edge.
func HasTrustPortfolio() predicate.BankAccount {
	return predicate.BankAccount(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2O, true, TrustPortfolioTable, TrustPortfolioColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasTrustPortfolioWith applies the HasEdge predicate on the "trust_portfolio" edge with a given conditions (other predicates).
func HasTrustPortfolioWith(preds ...predicate.Portfolio) predicate.BankAccount {
	return predicate.BankAccount(func(s *sql.Selector) {
		step := newTrustPortfolioStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// HasProperties applies the HasEdge predicate on the "properties" edge.
func HasProperties() predicate.BankAccount {
	return predicate.BankAccount(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, PropertiesTable, PropertiesColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

